    [],nt"num_tags": 9,nt"name": "refuge-narrative-report-september-to-december-1948-kenai-national-moose-range",nt"isopen":
    false,nt"url": null,nt"notes": "The 1948 September to December Narrative
    Report for the Kenai National Moose Range. The Kenai National Moose Range was established
    on December 16, 1941 after the establishing legislation was signed by President
    Roosevelt just nine days after Pearl Harbor. The reserve, 1,730,000 acres was set
    aside to protect important game species threatened by over harvesting by hunters.
    The annual narrative reports were written to document activities and management
    practices taking place on the reserve over the year. This is the initial report
    for the Kenai National Moose Range. The narratives typically contain information
    regarding weather conditions over the year as well as fire occurrence. In addition,
    there are summaries on game, fur bearing, carnivores and other wildlife including
    migratory and upland birds. Moose are the primary wildlife management focus and
    careful monitoring of them took place.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
